const repoLink = "";
const fiverrLink = "https://www.fiverr.com/zeeshan__alam";

const mainDesc = "Data Scientist, ML & AI Expert";
const aboutDesc = `Keeps Strong skillset in Artificial Intelligence and Datascience after several
