    percentage: 75,
    color: "#649bd3",
  },
  {
    name: "HTML & CSS",
    percentage: 90,
    color: "#e85324",
  },
];

const projects = [
  {
    title: "Background Generator",
    desc: "A tool for front end developers or designers to create background gradients for websites. User can customize colors and copy generated code.",
    demo: "https://gradient-background.netlify.app/",
    repo: "https://github.com/zeeshanalam39/background-generator",
  },
  {
    title: "MQTT Protocol Server",
    desc: "MQTT Server built using Berkeley Sockets to connect mqtt pub-sub.",
    demo: "",
    repo: "https://github.com/zeeshanalam39/mqtt-protocol-server",
  },
];

export {
  userName,
  githubLink,
  // twitterLink,
  linkedinLink,
  repoLink,
  fiverrLink,
  mainDesc,
  aboutDesc,
  langs,
  projects,
};
